      <Text style={{ textAlign: 'center' }}>{item.ten}</Text>
    </Pressable>
  );
  const renderHistory = ({ item }) => (
    <Pressable style={{ flexDirection: 'row' }}>
      <Ionicons name="search" size={20} color="grap" style={{ marginHorizontal: 10 }} />
      <Text>{item}</Text>
    </Pressable>
  );

  return (
    <View style={{ flex: 1 }}>
      <View style={{ height: 62, backgroundColor: '#0091FF', flexDirection: 'row', alignItems: 'center', paddingHorizontal: 10 }}>
        <Pressable onPress={() => navigation.goBack() }>
          <Ionicons name="arrow-back" size={24} color="white" style={{ padding: 10 }} />
        </Pressable>
        <Ionicons name="search" size={24} color="grap" style={{ position: 'absolute', marginStart: 50 }} />
        <TextInput style={{ flex: 1, height: 45, paddingLeft: 40, borderRadius: 10, color: 'black', backgroundColor: 'white' }} placeholder='Tìm kiếm' placeholderTextColor={'gray'} />
        <Pressable>
          <Ionicons name="qr-code" size={24} color="white" style={{ padding: 5, paddingStart: 15 }} />
        </Pressable>
      </View>
      <ScrollView>
        <View style={{ flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between', marginHorizontal: 10 }}>
          <Text style={{ fontWeight: 'bold' }}>Mini Apps bạn có thể tìm</Text>
          <Pressable><Ionicons name="close" size={24} color="gray" style={{ padding: 10 }} /></Pressable>
        </View>
        {/* FlatList component */}
        <View style={{ height: 100}} >
          <FlatList
            horizontal
            data={apps}
            renderItem={renderApps}
            keyExtractor={item => item.ten}
          />
          {/* <Pressable style={{ height: 100, width: 100, justifyContent: 'center', alignItems: 'center' }}>
            <Image source={{ uri: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTAs4NFiTfZlx2QIuLHM065SpQbpcku32bmow&usqp=CAU' }} style={{ width: 50, height: 50, borderRadius: 25 }} />
            <Text style={{ textAlign: 'center' }}>Thêm</Text>
          </Pressable> */}
        </View>
        <View style={{ marginVertical: 10, height: 1, backgroundColor: 'gray', marginHorizontal: 10 }} />
        <View style={{ flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between', marginHorizontal: 10 }}>
          <Text style={{ fontWeight: 'bold' }}>Liên hệ đã tìm</Text>
        </View>
        <View style={{ height: 100, flexDirection: 'row' }}>
          <FlatList
            horizontal
            data={users}
            renderItem={renderApps}
            keyExtractor={item => item.ten}
          />

        </View>
        <View style={{ marginVertical: 10, height: 1, backgroundColor: 'gray', marginHorizontal: 10 }} />
        <View style={{ flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between', marginHorizontal: 10 }}>
          <Text style={{ fontWeight: 'bold' }}>Truy cập nhanh</Text>
        </View>
        <View style={{ height: 100, flexDirection: 'row', alignItems: 'center' }}>
          <FlatList
            horizontal
            data={truyCap}
            renderItem={renderTruyCapNhanh}
            keyExtractor={item => item.ten}
            style={{ backgroundColor: 'yellow ' }}
          />
        </View>
        <View style={{ marginVertical: 10, height: 1, backgroundColor: 'gray', marginHorizontal: 10 }} />
        <View style={{ flexDirection: 'row', alignItems: 'center', justifyContent: 'space-between', marginHorizontal: 10 }}>
          <Text style={{ fontWeight: 'bold' }}>Từ khóa đã tìm</Text>
        </View>
        <FlatList
          data={searchHistory}
          renderItem={renderHistory}
          keyExtractor={(item, index) => index.toString()}
        />
        <View style={{ marginVertical: 10, height: 1, backgroundColor: 'gray', marginHorizontal: 10 }} />
        <Pressable style={{ flexDirection: 'row', alignItems: 'center', marginHorizontal: 10 }}>
          <Text style={{ color: '#0091FF' }}>Chỉnh sửa lịch sử tìm kiếm</Text>
          <Ionicons name="chevron-forward" size={20} color="#0091FF" style={{ marginLeft: 5 }} />
        </Pressable>
      </ScrollView>
    </View>
  );
}


export default TimKiem
